import React from 'react';
import { Link, useHistory } from 'react-router-dom';

const NavBar = () => {
    const history = useHistory();

    const handleRedirect = (path) => {
        history.push(path);
    };

    return (
        <nav className="bg-gray-800">
            <div className="container mx-auto px-4">
                <div className="flex items-center justify-between h-16">
                    <div className="flex items-center">
                        <div className="hidden md:block">
                            <div className="ml-10 flex items-baseline space-x-4">
                                <button onClick={() => handleRedirect("/")} className="text-white px-3 py-2 rounded-md text-sm font-medium">Home</button>
                                <button onClick={() => handleRedirect("/services")} className="text-white px-3 py-2 rounded-md text-sm font-medium">Services</button>
                                <button onClick={() => handleRedirect("/login")} className="text-white px-3 py-2 rounded-md text-sm font-medium">Login</button>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </nav>
    );
};

export default NavBar;
